import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import styles from '../css/footer.module.css';

import FacebookIcon from '../img/facebook.svg';
import InstagramIcon from '../assets/instagram-icon.svg';
import LinkedinIcon from '../assets/linkedin-icon.svg';

const Footer = () => {
  return (
    <footer className={styles.footer}>
      <Container>
        <Row>
          <Col md={6}>
            <h4>Footer Content</h4>
            <p>This is the footer content. You can add various information and links here.</p>
          </Col>
          <Col md={6} className="text-md-end">
            <h5>Contact Us</h5>
            <p>Email: example@example.com</p>
            <p>Phone: +1 234 56789</p>
            {/* Agrega los iconos con enlaces a tus perfiles */}
            <div>
              <a href="enlace-a-tu-perfil-de-Facebook"><img src={FacebookIcon} alt="Facebook" style={{ width: '30px', height: '30px' }} /></a>
              <a href="enlace-a-tu-perfil-de-Instagram"><img src={InstagramIcon} alt="Instagram" style={{ width: '30px', height: '30px' }} /></a>
              <a href="enlace-a-tu-perfil-de-LinkedIn"><img src={LinkedinIcon} alt="LinkedIn" style={{ width: '30px', height: '30px' }} /></a>
            </div>
          </Col>
        </Row>
        <hr className="bg-light" />
        <Row className="text-center">
          <Col>
            <p>&copy; {new Date().getFullYear()} YourWebsite. All Rights Reserved.</p>
          </Col>
        </Row>
      </Container>
    </footer>
  );
};

export default Footer;
